import React from "react"

const Cell = ({ data, handleClick, colorHex }) => {
  return (
    <button
      style={{backgroundColor: colorHex}}
      className={`border border-black w-[50px] h-[50px]`}
      onClick={() => handleClick()}
    >
      {data.cnt}
    </button>
  )
}

export default Cell
